import React, { useState } from "react";

import "./App.css";

function App() {
  const [inputList, setInputList] = useState("");

  const itemEvent = (event) => {
    setInputList();
  };

  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <br />
          <h1>ToDo List</h1>
          <br />
          <input type="text" placeholder="Enter a Items" onChange={itemEvent} />
          <button>+</button>

          <ol>
            <li>{inputList}</li>
          </ol>
        </div>
      </div>
    </>
  );
}

export default App;
